import { link } from 'fs';
import React, { useEffect } from 'react';
import ISidebar from '../../interfaces/ISidebar';

interface Props {
  sidebar: ISidebar;
}

const Sidebar = ({ sidebar: { title, logoPath, links } }: Props) => {
  const renderLinks = (): React.ReactNode => {
    return (
      links.map((l): React.ReactNode => {
        return (
          <div>
            {l.name}
          </div>
        )
      })
    )
  }
  return (
    <>
      <div>
        <img className="" src={logoPath} alt="logo" />
        <div>{title}</div>
        <div>
          {renderLinks()}
        </div>
      </div>
    </>
  )
}

export default Sidebar;
